    "2016-03-17T07:01:14.228234",nt"name": "statement-of-economic-interests-database-sei-form-700-7a93f",nt"isopen":
    true,nt"url": null,nt"notes": "The Form 700: Statement of Economic Interests
    (SEI) is a form that state and local public officials and designated employees must
    file to disclose their financial interests when assuming office, annually, and leaving
    office.  Any officer or employee of the City and County of San Francisco who holds
    a position designated in the Conflict of Interest Code (San Francisco Campaign and
    Government Conduct Code, Article III, Chapter I) is required to disclose his or
    her financial interests.Elected officials, department heads, and members of decision-making
    boards and commissions file with the Ethics Commission.  SEI filings filed with
    the Ethics Commission are accessible from this database.  The filing data is updated
    every 24 hours.  The list of filers and non-filers may be exported to Microsoft
    Excel format.  The forms are available in PDF format.Advisory board and committee
    members and designated employees file with their department or commission.  These
    filers are NOT accessible from this database.  Please check with the filer's respective
    department to obtain a copy of the filing.",nt"license_title": "Other License
